create table dish (
	id INT PRIMARY KEY AUTO_INCREMENT UNIQUE,
	_id VARCHAR(50),
	Name VARCHAR(50),
	Description TEXT,
	Price DECIMAL(5,2),
	Category TEXT,
	Availability TEXT,
	WaitTimeMinutes INT,
	SoldOut INT,
	Rating DECIMAL(2,1),
	Created DATETIME,
	Changed DATETIME
);
ALTER TABLE dish RENAME COLUMN id TO IDDish;